import React, { Fragment } from "react";
import { Container } from "react-bootstrap";
import { Image } from "react-bootstrap";
import { Navbar } from "react-bootstrap";
import { Nav } from "react-bootstrap";

export default function Profile() {
    return (
        <Fragment>
            <Container id="ContainerMainPage">
                <Navbar id="LogNavbar" variant="dark" expand="lg">
                    <Container>
                    <Image id="avatar" src="https://i.pinimg.com/originals/6c/0f/56/6c0f56bbe60aa6c72f384215326a0ca3.jpg" />
                        <Nav className="me-auto">
                            <Nav.Link href="#a">Likes</Nav.Link>
                            <Nav.Link href="#b">Listas</Nav.Link>
                            <Nav.Link href="#c">Seguidos</Nav.Link>
                            <Nav.Link href="#d">Seguidores</Nav.Link>
                        </Nav>
                    </Container>
                </Navbar>
            </Container>
        </Fragment>
    );
}
